import React from 'react';
import './style.css';
import logo from './img/logo.png';
import Login from './components/Login'; // Import lớp Login

const Navbar = ({ isLoggedIn }) => {
  const handleLogoClick = () => {
    window.location.href = 'http://localhost:3000/';
  };

  const handleSignInClick = () => {
    // Thực hiện chuyển hướng đến trang Login khi nhấn nút Sign In
    window.location.href = 'http://localhost:3000/#sign-in';
  };

  return (
    <div className="navbar">
      <a href="#rent">Rent</a>
      <a href="#shared-accommodation">Shared Accommodation</a>
      <a href="#agent-finder">Agent Finder</a>
      <div className="logo" onClick={handleLogoClick}>
        <img src={logo} alt="Logo" />
      </div>
      <a href="#manage-rentals">Manage Rentals</a>
      <a href="#favourite">Favourite</a>
      <a href="#sign-in" onClick={handleSignInClick}>
        Sign In
      </a>

      {/* Hiển thị phần Login khi nhấn vào nút Sign In */}
      <div id="sign-in">
        <Login />
      </div>
    </div>
  );
};

export default Navbar;
